<area shape="rect" id="id1" href="Aim.html" title="Aim is the base class for things to which engineered capabilities and other aims can be aligned. " alt="" coords="1874,1492,1927,1548"/>
<area shape="rect" id="id2" href="Goal.html" title="Goal is an aim defined under a persona and its sub-types - engineer and organization. " alt="" coords="1405,1654,1463,1710"/>
<area shape="rect" id="id3" href="Topic.html" title="Topic is a group of related messages in a forum. " alt="" coords="121,1654,183,1710"/>
<area shape="rect" id="id4" href="Event.html" title="Event is a named temporal. " alt="" coords="399,1492,461,1548"/>
<area shape="rect" id="id5" href="Forum.html" title="Discussion forum which can contain sub-forums and discussion topics. " alt="" coords="609,1492,677,1548"/>
<area shape="rect" id="id6" href="Module.html" title="Module is a part of product or another module. " alt="" coords="1827,1830,1899,1886"/>
<area shape="rect" id="id7" href="Product.html" title="Product is an object or a system made available for consumer use. " alt="" coords="1985,1999,2059,2055"/>
<area shape="rect" id="id8" href="Feature.html" title="Feature is a unit of consumption of product functionality. " alt="" coords="1985,2147,2059,2203"/>

<area shape="rect" id="id10" href="Release.html" title="Release is a unit of delivering product features to its consumers. " alt="" coords="1118,494,1197,550"/>
<area shape="rect" id="id11" href="Persona.html" title="Personas represent represent the different types of consumers of products and services. " alt="" coords="1519,1492,1598,1548"/>
<area shape="rect" id="id12" href="Principle.html" title="Principles are general rules and guidelines, intended to be enduring and seldom amended, that inform and support the way in which an engineer or an organization sets about achieving its goals or addressing goals of their consumers modeled as personas..." alt="" coords="1684,1654,1764,1710"/>
<area shape="rect" id="id13" href="Directory.html" title="Directory is a container of named elements, e.g. documents, links, or other directories. " alt="" coords="900,1203,980,1259"/>
<area shape="rect" id="id14" href="Objective.html" title="Objective is something that should be achieved as part of endeavor such as an increment or a release. " alt="" coords="479,1830,561,1886"/>
<area shape="rect" id="id15" href="Alignable.html" title="Something that can be aligned to aims by alignments - aims or endeavors." alt="" coords="2017,63,2102,119"/>
<area shape="rect" id="id16" href="Allocation.html" title="Allocation of engineer’s capacity to spend on a particular engineered element and issue category on a particular endeavor. " alt="" coords="1686,1999,1771,2055"/>
<area shape="rect" id="id17" href="Increment.html" title="Increment is a period of time to plan releases and schedule issues for. " alt="" coords="1311,377,1398,433"/>
<area shape="rect" id="id18" href="Link.html" title="Link to an external URL. " alt="" coords="496,1485,573,1554"/>
<area shape="rect" id="id19" href="IssuePriority.html" title="Issue priority, e.g. Low, Medium, High. " alt="" coords="970,1830,1070,1886"/>
<area shape="rect" id="id20" href="Organization.html" title="Organization is an engineer which can contain other engineers, and organizations as such. " alt="" coords="1253,1830,1354,1886"/>
<area shape="rect" id="id21" href="Message.html" title="A message in a discussion topic authored by an engineer on a specific date." alt="" coords="69,1485,152,1554"/>
<area shape="rect" id="id22" href="IssueSeverity.html" title="Issue severity, e.g. Feature, Minor, Major, Crash. " alt="" coords="1427,1830,1532,1886"/>
<area shape="rect" id="id23" href="Alignment.html" title="An association class between aims and engineered capabilities. " alt="" coords="1917,232,2004,301"/>
<area shape="rect" id="id24" href="NamedElement.html" title="Named element, as the name suggests, is a base class for model elements with a name." alt="" coords="583,1351,702,1407"/>
<area shape="rect" id="id25" href="IssueStatus.html" title="Issue status, e.g. Open, In Progress, Done. " alt="" coords="837,1823,935,1892"/>
<area shape="rect" id="id26" href="Capability.html" title="Capability is something that can be required by an issue to start working on it. " alt="" coords="989,1485,1091,1554"/>
<area shape="rect" id="id27" href="EngineeredElement.html" title="Engineered element is something that is “brought about” by engineers working on issues associated with the engineered element. " alt="" coords="1393,948,1535,1004"/>
<area shape="rect" id="id28" href="Capacity.html" title="Capacity is contained under Engineer and defines how much total effort or funds the containing engineer has to spend on a particular endeavor. " alt="" coords="2031,1809,2113,1906"/>
<area shape="rect" id="id29" href="Engineer.html" title="Engineers are entities, people or organizations, owning engineered elements and working on endeavors, e.g. issues. " alt="" coords="1196,1640,1295,1723"/>
<area shape="rect" id="id30" href="EngineeredCapability.html" title="Engineered capability extends both endeavor and capability and is a base class for issue, feature, and release. " alt="" coords="1063,628,1213,684"/>
<area shape="rect" id="id31" href="KeyResult.html" title="Key Results are specific measures used to track achievement of their containing objective. " alt="" coords="718,1985,823,2068"/>
<area shape="rect" id="id32" href="IssueCategory.html" title="A mechanism for grouping/tagging issues. " alt="" coords="1568,1816,1680,1899"/>
<area shape="rect" id="id33" href="NamedElementReference.html" title="References a named element. " alt="" coords="188,1492,364,1548"/>
<area shape="rect" id="id34" href="Endeavor.html" title="Endeavor is a base class for things which take time, effort, and money to achieve some benefit - increments, and engineered capabilities - issues, features, and releases. " alt="" coords="1079,218,1184,315"/>
<area shape="rect" id="id35" href="Decision.html" title="Decision is an issue, which is also an aim, i.e. endeavors, such as issues, and other aims such as other decisions may be aligned to it. " alt="" coords="1874,1633,1983,1730"/>
